import React, { Component } from "react";
import { Nav, Li, LinkTo, Ul, Nav2 } from "./SideNavBar.jsx";
import SideTrigger from "./SideTrigger.js";

export default class SideNavBar extends Component {
  state = {
    isOpen: false
  };

  handleSideBar = () => {
    this.setState(prevState => {
      return { isOpen: !prevState.isOpen };
    });
  };
  render() {
    const { isOpen } = this.state;
    let stateofSideBar;
    if (isOpen) {
      stateofSideBar = (
        <Nav>
          <SideTrigger />
          <Ul>
            <Li>
              <LinkTo to="/secret">My Profile</LinkTo>
            </Li>
            <Li>
              <LinkTo to="/logout">Logout</LinkTo>
            </Li>
          </Ul>
        </Nav>
      );
    } else {
      stateofSideBar = (
        <Nav2>
          <SideTrigger />
          <Ul>
            <Li>
              <LinkTo to="/secret">My Profile</LinkTo>
            </Li>
            <Li>
              <LinkTo to="/logout">Logout</LinkTo>
            </Li>
          </Ul>
        </Nav2>
      );
    }
    return <div>{stateofSideBar}</div>;
  }
}
